import * as React from 'react'
import './App.css';

class App extends React.Component {
    render() {
        return (
            <React.Fragment>
                <Header/>
            </React.Fragment>
        );
    }
}

const Header: React.SFC = () => (
    <div>
        <h1>Hello, this is Lica`s movie app</h1>
    </div>
);



export default App;
